import './App.css';
import ExpenseItem from './components/Expense/ExpenseItem';

function App() {

    const Expenses = [
        {ItemDate: new Date(), Title: 'Item 1', Price: '19.4'},
        {ItemDate: '29th March 2021', Title: 'Item 2', Price: '31.1'},
        {ItemDate: '30th March 2021', Title: 'Item 3', Price: '20.5'}
    ];

    return (
        <div>
            {Expenses.map(exp => 
              <ExpenseItem 
                    ItemDate = {exp.ItemDate}
                    Title = {exp.Title}
                    Price = {exp.Price}
                />  
            )}
        </div>
    );
}

export default App;
